import React from 'react';
import NavBar from './Components/navbar/NavBar';
import Videos from './Components/video*';
import { BrowserRouter as Router, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <NavBar />
        <Route path="/videos" exact component={Videos} />
      </Router>
    </div>
  );
}

export default App;
